const Runnerups = ({ title, image, author }) => {
    return (
        <div className='runner-card'>
            <div className='runner-image'></div>
            <div className='runner-details'>
                <div className='runner-title'>
                    {title}
                </div>
                <div className='runner-subtitle'>
                    {author}
                </div>
            </div>

        </div>
    )
}

export default Runnerups
